(2, 'EURON 3300 ME', 'III - viši bezbedonosni stepen. Procesor upravlja bravom Timelock - Sophia, na glavnim vratima. Sertifikat: III stepen po EURO normi 1143 - …, TOP SECRET. Unutrašnjost sefa podeljena je na 2 mehaničkom bravom zaključavajuća dela. Elektronska brava,odbravljuje vrata .Programiranje radnog vremena sefa. Programiranje 1 korisnik ili princip saključarstvo. 10 kodova - 1 administrator.Programiranje trenutne ili vremenske brave. Očitavanje datoteke : 4090 radnji sa sefom . Sef je 4 – ro SLOJAN -između slojeva VATROOTPORNA SMEŠA', '2900', 'image/jpg', 1, 'Antracit', 'Mehanička Kaba – Mauer više klase + Elektronska Time Lock Sophia + unutrašnja od ormarića - Eurolock ', '', 'u 4 smera i 10 tačaka', 'Sidrenje u pod', '1400', '610', '530', '1230', '470', '295', '4', '420', '188', '2014-08-19 15:38:18', '2014-08-19 15:38:18', );
