(3, 'EURON 110 P / P', 'Sertifikovan u II bezbednosni stepen. Telo sefa troslojno, vrata 4 – ro slojna. Procesor upravlja elektronskom bravom Timelok – Sophia, na glavnim vratima. Unutrašnjost sefa: podešavajuće police po visini + zaključavajući deo U unutrašnji deo se mogu smestiti registratori u 2 reda – oko 12-14 komada. El. Bravom se mogu otvarati vrata pomoću 10 sedmocifrenih kodova, od kojih je 1 Administrativni. Sef ima mogućnost programiranja blokade, u vanradno vreme (praznici, godišnji odmor, vikendi …), i neće se otvoriti uprkos zadatom kodu. Opremljen je meh. bravom Kaba – Mauer za tkz. Nužno otvaranje tj. brava je u funkciji Master ključa. Datoteka pamti zadnjih 4900 radnji sa sefom (otvaranje, zatvaranje, promena koda … ), kako sa glavnim vratima, tako i sa oba unutrašnja dela po datumu i vremenu.', '2000', 'image/jpg', 1, 'Antracit', '', '', 'u 4 smera i 14 tačaka', 'Sidrenje u pod', '1100', '600', '500', '910', '480', '360', '2', '253', '151', '2014-08-19 15:38:18', '2014-08-19 15:38:18', );
